contracts/coordinator.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.2 <0.9.0;

import "./company.sol"; // Assuming this is the interface for the Company contract
import "./IGovernment.sol"; // Interface for the Government contract

contract Coordinator {
    Company public companyContract;
    IGovernment public governmentContract;

    constructor(address _companyContractAddress, address _governmentContractAddress) {
        companyContract = Company(_companyContractAddress);
        governmentContract = IGovernment(_governmentContractAddress);
    }

    function forwardBusToGovernment(uint256 busId) public {
        // Ensure only authorized users can forward buses
        // Access control check here (e.g., require statement or modifier)

        Company.BusItem memory bus = companyContract.getBusData(busId);
        require(bus.id != 0, "Bus does not exist");
        require(bus.status == Company.BusStatus.Waiting, "Bus is not in a valid state to be forwarded");

        companyContract.updateBusStatusAndOwner(busId, Company.BusStatus.ForwardToHTMC, address(governmentContract));
    }

    function rejectBus(uint256 busId) public {
        // Ensure only authorized users can reject buses
        // Access control check here

        Company.BusItem memory bus = companyContract.getBusData(busId);
        require(bus.id != 0, "Bus does not exist");
        require(bus.status == Company.BusStatus.Waiting, "Bus is not in a valid state for rejection");

        companyContract.updateBusStatusAndOwner(busId, Company.BusStatus.Rejected, address(this));
    }

    function noteBus(uint256 busId, string memory note) public {
        // Ensure only authorized users can add notes to buses
        // Access control check here

        Company.BusItem memory bus = companyContract.getBusData(busId);
        require(bus.id != 0, "Bus does not exist");
        require(bus.status == Company.BusStatus.Waiting, "Bus is not in a valid state for noting");

        // Assuming Company contract has a method to add a note to the bus
        // companyContract.addNoteToBus(busId, note);
        companyContract.updateBusStatusAndOwner(busId, Company.BusStatus.Noted, address(this));
    }

    // Additional functions as needed...
}

