contracts/company.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.2 <0.9.0;

contract Company {
    enum BusStatus { Waiting, Approved, Rejected, Noted, ForwardToHTMC }

    struct BusItem {
        uint256 id;
        uint256 model;
        string vim_number;
        uint256 company_number;
        string plate_number;
        uint256 nft_token_id;
        uint256 expire_date;
        BusStatus status;
        address owner;
        address creator;
    }

    mapping(uint256 => BusItem) public buses;
    address public coordinatorAddress;

    constructor() {
        // Set up contract deployment logic, if any
    }

    function addBus(uint256 id, BusItem memory bus) public {
        // Ensure only authorized users can add buses
        buses[id] = bus;
    }

    function getBusData(uint256 id) public view returns (BusItem memory) {
        return buses[id];
    }

    function updateBusStatusAndOwner(uint256 id, BusStatus newStatus, address newOwner) public {
        // Ensure only authorized users can update bus status and owner
        buses[id].status = newStatus;
        buses[id].owner = newOwner;
    }

    // Additional functions as needed...
}

